        videoDescription:
          'A Ségou, dans la cour de Biton, des notables bambaras boivent de la bière de mil préparée par Banadiè. Deux femmes échappent aux brigands, arrivent essoufflées. Les notables bambaras s’indignent de cette attaque. Et comme ce type d’agression se répète trop souvent, ils se proposent de former un « ton » (association en Bambara) pour mieux se défendre.Le soir, Saran, une des femmes poursuivies, accuse son mari Kroungo de l’avoir abandonnée à la vue des brigands. Elle refuse de partager sa couche avec un lâche. Biton déclaré chef du ton interdit l’accès au fleuve un jour de la semaine. De plus, pour entretenir les hommes armés, il décide de lever un impôt obligatoire en espèce ou en nature voir même des personnes physiques qui vont servir dans l’armée du « ton ». Certains notables sont mécontents de ces décisions. L’armée de Sido Karafé est défaite. Sido Karafé, Toto Kourou et Bansandoni Koné alors membres fondateurs du « ton » capturés sont conduits devant Biton avec leurs hommes. Ils seront rasés et incorporés dans l’armée. Quelques temps plus tard, Kamissa gnognon le frère de Binaba se moque de Biton. Biton l’arrête et le fait tuer. La femme de Sido Karafé, lui apporte l’eau du fleuve et s’accuse d’avoir incité son mari à la révolte et d’être responsable de la prise de Sido par Biton.',
